@@ -1,35 +1,35 @@
-/* { dg-do compile } */
-/* { dg-options "-O2 -fno-tree-ccp -fdump-tree-vrp1" } */
-
-int f(int x)
-{
-  if (x >= 0 && x <= 3)
-    {
-      x = x ^ 3;
-      x = x & 3;
-    }
-  return x;
-}
-
-int g(int x)
-{
-  if (x >= 0 && x <= 3)
-    {
-      x = x ^ 2;
-      x = x & 3;
-    }
-  return x;
-}
-
-int h(int x)
-{
-  if (x >= 0 && x <= 3)
-    {
-      x = x ^ 1;
-      x = x & 3;
-    }
-  return x;
-}
-
-/* { dg-final { scan-tree-dump-not " & 3;" "vrp1" } } */
-/* { dg-final { cleanup-tree-dump "vrp1" } } */
+/* { dg-do compile } */
+/* { dg-options "-O2 -fno-tree-ccp -fdump-tree-vrp1" } */
+
+int f(int x)
+{
+  if (x >= 0 && x <= 3)
+    {
+      x = x ^ 3;
+      x = x & 3;
+    }
+  return x;
+}
+
+int g(int x)
+{
+  if (x >= 0 && x <= 3)
+    {
+      x = x ^ 2;
+      x = x & 3;
+    }
+  return x;
+}
+
+int h(int x)
+{
+  if (x >= 0 && x <= 3)
+    {
+      x = x ^ 1;
+      x = x & 3;
+    }
+  return x;
+}
+
+/* { dg-final { scan-tree-dump-not " & 3;" "vrp1" } } */
+/* { dg-final { cleanup-tree-dump "vrp1" } } */

@@ -1,31 +1,31 @@
-/* { dg-do compile } */
-/* { dg-options "-O2 -fno-tree-ccp -fno-tree-dominator-opts -fdump-tree-vrp1" } */
-
-int foo (int x, int b)
-{
-  int cst;
-  if (b)
-    cst = -__INT_MAX__ - 1;
-  else
-    cst = -__INT_MAX__;
-  x = x | cst;
-  if (x >= 0)
-    return 12345;
-  return x;
-}
-
-int bar (int x, int b)
-{
-  int cst;
-  if (b)
-    cst = __INT_MAX__;
-  else
-    cst = __INT_MAX__ - 1;
-  x = x & cst;
-  if (x < 0)
-    return 12345;
-  return x;
-}
-
-/* { dg-final { scan-tree-dump-not "12345" "vrp1" } } */
-/* { dg-final { cleanup-tree-dump "vrp1" } } */
+/* { dg-do compile } */
+/* { dg-options "-O2 -fno-tree-ccp -fno-tree-dominator-opts -fdump-tree-vrp1" } */
+
+int foo (int x, int b)
+{
+  int cst;
+  if (b)
+    cst = -__INT_MAX__ - 1;
+  else
+    cst = -__INT_MAX__;
+  x = x | cst;
+  if (x >= 0)
+    return 12345;
+  return x;
+}
+
+int bar (int x, int b)
+{
+  int cst;
+  if (b)
+    cst = __INT_MAX__;
+  else
+    cst = __INT_MAX__ - 1;
+  x = x & cst;
+  if (x < 0)
+    return 12345;
+  return x;
+}
+
+/* { dg-final { scan-tree-dump-not "12345" "vrp1" } } */
+/* { dg-final { cleanup-tree-dump "vrp1" } } */
